INSERT INTO `institution` VALUES ('-','2021-01-08 16:51:08','-','2021-01-08 16:51:08',0,59,'GOSL',0,3,NULL,NULL,NULL,NULL,0,1,'Government of the Democratic Socialist Republic of Sri Lanka',1,NULL,1),('-','2021-01-09 05:06:54','-','2021-01-09 05:06:54',0,66,'Ministry of Defense',0,3,NULL,NULL,NULL,59,0,1,'Creating a country where law and order is established, devoid of crime, anti-social and terrorist activities, thereby guaranteeing the security of all communities of Sri Lanka prioritizing the consolidation of National Security.',1,NULL,0),('-','2021-01-09 05:07:46','-','2021-01-09 05:07:46',0,67,'Ministry of Finance',0,3,NULL,NULL,NULL,59,0,1,'The Ministry of Finance is a cabinet ministry of the Government of Sri Lanka responsible for developing and executing the government\'s public finance policy, economic policy and long term fiscal planning. The Treasury is housed at the General Treasury Building in Fort.\n',1,NULL,0),('-','2021-01-09 05:08:51','-','2021-01-09 05:08:51',0,68,'Ministry of Urban Development and Housing',0,3,NULL,NULL,NULL,59,0,1,'Creating comfortable and clean cities as an economic centre through a novel approach in the physical space and providing residential and urban facilities required by the people.',1,NULL,0),('-','2021-01-09 05:32:09','-','2021-01-09 05:32:09',0,69,'Ministry of Health',0,3,NULL,NULL,NULL,59,0,1,'The Ministry of Health, Nutrition and Indigenous Medicine is the central government ministry of Sri Lanka responsible for health. The ministry is responsible for formulating and implementing national policy on health, nutrition, indigenous medicine and other subjects which come under its purview.',1,NULL,0),('-','2021-01-09 05:33:17','-','2021-01-09 05:33:17',0,70,'Ministry of Environment',0,3,NULL,NULL,NULL,59,0,1,'Use of natural resources while safeguarding Sri Lanka’s bio diversity and natural beauty for sustainable\ndevelopment, as well as protection of flora, beaches, marshy lands, streams and rivers and wildlife, prevention of waste accumulation, disposal of waste, a clean residential environment and matters related to environmental policies and institutions to ensure sustainable economic development.',1,NULL,0),('-','2021-01-09 05:34:57','-','2021-01-09 05:34:57',0,71,'Ministry of Wildlife and Forest Conservation',0,3,NULL,NULL,NULL,59,0,1,'Fostering biodiversity by conservation of wildlife & forest and expanding national forest cover through\nenvironmental sensitive forest plantation and conservation of natural environment of wildlife.',1,NULL,0),('-','2021-01-09 05:36:00','-','2021-01-09 05:36:00',0,72,'Ministry of Agriculture',0,3,NULL,NULL,NULL,59,0,1,'The Ministry of Agriculture is the central government ministry of Sri Lanka responsible for agriculture. The ministry is responsible for formulating and implementing national policy on home affairs and other subjects which come under its purview.',1,NULL,0),('-','2021-01-09 05:51:18','-','2021-01-09 05:51:18',0,73,'Ministry of Power',0,3,NULL,NULL,NULL,59,0,1,'Catering to the power requirement of all urban and rural communities based on the long term power generation plan and providing power supply that establishes the market competitiveness of Sri Lankan businesses, and establishing energy security. \n',1,NULL,0),('-','2021-01-09 05:53:30','-','2021-01-09 05:53:30',0,74,'Ministry of Energy.',0,3,NULL,NULL,NULL,59,0,1,'Enhancing the capacity for by products including petroleum and gas thus meeting the national requirement so as to curtail all fuel imports and expanding the storage facilities and distribution and regulating the related standards and efficient maintenance of the related state enterprises to ensure energy security. ',1,NULL,0),('-','2021-01-09 05:54:39','-','2021-01-09 05:54:39',0,75,'Ministry of Industries',0,3,NULL,NULL,NULL,59,0,1,'Strengthening and promoting local industrial sector by adoption of advanced strategies in order to earn relatively\nlarge profit in the context of global competition by establishing links with the local, regional and international\nsupply network through diversification of industries. ',1,NULL,0),('-','2021-01-09 05:59:27','-','2021-01-09 05:59:27',0,76,'Ministry of Transport',0,3,NULL,NULL,NULL,59,0,1,'The Ministry of Transport is the central government ministry of Sri Lanka responsible for transport. The ministry is responsible for formulating and implementing national policy on transport and other subjects which come under its purview. ',1,NULL,0),('-','2021-01-09 06:00:15','-','2021-01-09 06:00:15',0,77,'Ministry of Tourism',0,3,NULL,NULL,NULL,59,0,1,'The Ministry of Tourism and Aviation was established on 10thDecember 2019 under the extraordinary gazette No. 2153/12. Among the main objectives of the establishment of a dedicated Ministry in charge of the tourism and Aviation sectors are making available an appropriate policy and regulatory framework, ensure robust infrastructure development and Aviation, promotion of destination Sri Lanka and exercise administrative and financial overview over institutions Gazetted under the Ministry. ',1,NULL,0),('-','2021-01-09 06:01:59','-','2021-01-09 06:01:59',0,78,'Ministry of Public Services, Provincial Councils and Local Government',0,3,NULL,NULL,NULL,59,0,1,'Effect a full capacity development of all government services and deliver optimal services to customers, avoiding duplication of functions by adoption of modern information technology methodologies and provide a high standard of service to the people thereby minimizing inequalities existing at provincial and divisional levels.',1,NULL,0),('-','2021-01-09 06:02:47','-','2021-01-09 06:02:47',0,79,'Ministry of Water Supply',0,3,NULL,NULL,NULL,59,0,1,'The ministry is responsible for people with favorable living conditions through sustainable city planning, safe drinking water supply and improved sanitation facilities, while ensuring the protection of the living environment and water resources.',1,NULL,0),('-','2021-01-09 06:14:22','-','2021-01-09 06:14:22',0,80,'Ministry of Plantation',0,3,NULL,NULL,NULL,59,0,1,'Re-orienting overall plantation industry aimed at attracting export market by diversification of value-added\nproduction through the adoption of research techniques, new technological tools and the optimum utilization\nof land.',1,NULL,0),('-','2021-01-09 06:16:26','-','2021-01-09 06:16:26',0,81,'Ministry of Trade',0,3,NULL,NULL,NULL,59,0,1,'Initiating actions to make available required consumer commodities to the general public through a competitive\nlocal trade network safeguarding the consumer rights. \n',1,NULL,0),('-','2021-01-09 06:17:29','-','2021-01-09 06:17:29',0,82,'Ministry of Lands',0,3,NULL,NULL,NULL,59,0,1,'Ministry of Land was established in 1932. The objectives of the Ministry are to formulate and implement state land policies, conserve state lands, and implement activities related to land settlement and land acquisition for public purposes.',1,NULL,0),('-','2021-01-09 06:38:56','-','2021-01-09 06:38:56',0,83,'Blah BLah',0,2,NULL,4,NULL,59,0,1,'Blah BLah',3,'2021-01-09 06:39:40.000000',0),('-','2021-01-09 06:49:19','-','2021-01-09 06:49:19',0,84,'Ministry of Irrigation',0,3,NULL,NULL,NULL,59,0,1,'The Ministry of Irrigation is the cabinet ministry of the Government of Sri Lanka responsible for: The development of the nation\'s water resources and irrigation infrastructure',1,NULL,0),('-','2021-01-09 06:51:04','-','2021-01-09 06:51:04',0,85,'Ministry of Highways',0,3,NULL,NULL,NULL,59,0,1,'Providing road facilities to the movement of people and establishing integrated road system required to advanced\nSri Lanka towards a develop economy',1,NULL,0),('-','2021-01-09 06:52:02','-','2021-01-09 06:52:02',0,86,'Ministry of Fisheries',0,3,NULL,NULL,NULL,59,0,1,'Creating a fisheries industry that contributes highly to the national economy thereby producing a socially\nrobust business community within the local and overseas market catering to the needs of local fish consumers',1,NULL,0),('-','2021-01-09 06:52:59','-','2021-01-09 06:52:59',0,87,'Ministry of Justice',0,3,NULL,NULL,NULL,59,0,1,'Implementing constitutional reforms according prominence to the sovereignty of the people, and creating the legal background and providing physical facilities to protect the Rule of Law and act in full fairness to all who approach the Law or seek protection of the Law.',1,NULL,0),('-','2021-01-09 06:53:50','-','2021-01-09 06:53:50',0,88,'Ministry of Education',0,3,NULL,NULL,NULL,59,0,1,'Providing opportunities for the future generation to access child friendly education, innovation-based knowledge and an excellent higher education system by adoption of sustainable education strategies in order to empower the Sri Lankan people towards a knowledge-based socio-economy.',1,NULL,0),('-','2021-01-09 07:51:38','-','2021-01-09 07:51:38',0,89,'CCS - Climate Change Secretariat',0,3,NULL,NULL,NULL,70,0,2,'In order to address the cross sectoral  nature of major environmental challenges caused by climate change, and to fulfill the commitments under the United Nations Framework Convention on Climate Change (UNFCCC) &  Kyoto Protocol, the Ministry of Environment, which is the National Focal Point for the UNFCCC and Kyoto Protocol has taken the initiative to establish a Climate Change Secretariat under it’s  preview.\n\nThe Climate Change Secretariat, which is headed by the Director of the Climate Change Division, adopts a comprehensive national approach to address climate change challenges that  as these concerns  categorize  as an environmental concern, which is also a development issue of Sri Lanka.',1,NULL,0),('-','2021-01-09 11:39:35','-','2021-01-09 11:39:35',0,90,'State Ministry of Internal Security, Home Affairs and Disaster Management',0,3,NULL,NULL,NULL,66,0,1,'Assisting in the formulation of policies in relation to the subject of Internal Security, Home Affairs and Disaster Management for the creation of a “secure country” under the direction and guidance of the Minister of Defence in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-09 11:41:09','-','2021-01-09 11:41:09',0,91,'Department of Meteorology',0,3,NULL,NULL,NULL,90,0,1,'It responsible  to provide services pertaining to Meteorology, Aeronautical Meteorology, Ocean Meteorology, Hydro Meteorology, Agricultural Meteorology, Climatology and Astronomy to government agencies, private sector and the general public in keeping with national interest and international standards.',1,NULL,0),('-','2021-01-09 12:03:14','-','2021-01-09 12:03:14',0,92,'Central Environmental Authority',0,3,NULL,NULL,NULL,70,0,1,'The Central Environmental Authority was established on 12th August 1981 in accordance with the provisions of the National Environmental Act No 47 of 1980. At the inception the main objectives of the Authority were co-ordination of environmental activities and the formulation and review of environmental policy.',1,NULL,0),('-','2021-01-09 12:04:24','-','2021-01-09 12:04:24',0,93,'Geological Surveys and Mines Bureau',0,3,NULL,NULL,NULL,70,0,1,'The Geological Survey and Mines Bureau has always been responsive towards social and environmental issues of the country. It has nurtured corporate attitude and sensitivity over the years fulfilling its obligation to the society while maintaining a robust financial status.',1,NULL,0),('-','2021-01-09 13:42:22','-','2021-01-09 13:42:22',0,94,'State Ministry of Solar, Wind and Hydro Power Generation Projects Development',0,3,NULL,NULL,NULL,73,0,1,'Assisting in the formulation of policies in relation to the subject of Solar, Wind and Hydro Power Generation Projects Development for \"Assuring of obtaining low cost power\" under the direction and guidance of the Minister of Power in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-09 13:49:14','-','2021-01-09 13:49:14',0,95,'Sri Lanka Sustainable Energy Authority',0,3,NULL,NULL,NULL,94,0,1,'The Sri Lanka Sustainable Energy Authority (or SLSEA) is the primary body responsible for the issuance of licenses for sustainable energy developments in Sri Lanka. In addition to being the key license provider, it is also the organization responsible for promoting renewable energy and sustainable developments in the country.',1,NULL,0),('-','2021-01-09 13:52:11','-','2021-01-09 13:52:11',0,96,'Ceylon Electricity Board',0,1,NULL,NULL,NULL,73,0,1,'Ceylon Electricity Board is a body corporate established on the 1st November 1969 under the Act of Parliament No. 17 of 1969. It is empowered to generate electrical energy, transmit the same and distribute it to reach all categories of consumers and to collect the revenue.',1,'2021-02-12 09:59:49.000000',0),('-','2021-01-09 13:53:27','-','2021-01-09 13:53:27',0,97,'Lanka Electricity Company',0,1,NULL,NULL,NULL,73,0,1,'Description of Lanka Electricity Company',1,NULL,0),('-','2021-01-09 14:02:43','-','2021-01-09 14:02:43',0,98,'Yuga Danavi (Kerawalapitiya) Power Station',0,2,NULL,NULL,NULL,99,0,1,'ince the entrance to the field of power generation, the Company has become a leading Independent Power Producer in the South East Asian Region. In this process the Company developed skills and experience in Engineering, Procurement, Construction, Operation and Maintenance of power plants. Today LTL is maintaining several plants satisfying global standards & the latest power plant constructed and maintained by the company is a 300MW Combined Circle Power Plant, which is multi fuel capable plant presently operating on Heavy Fuel Oil.\n\nAt present, LTL has 424MW of thermal power generation capacity & considering 2009 statistics, LTL has supplied 25% of the total thermal power generation by Independent Power Producers.\n\nThe utilization of the latest available technologies at the power plant constructed has enable to have the highest level of efficiencies and supply electricity at the lowest possible cost',1,'2021-01-10 17:39:58.000000',0),('-','2021-01-09 14:04:55','-','2021-01-09 14:04:55',0,99,'Private Company',0,2,NULL,NULL,NULL,59,0,1,'This is not a Separate definite institution. This will serve as the parent of private companies',1,'2021-01-10 17:40:53.000000',0),('-','2021-01-09 14:23:35','-','2021-01-09 14:23:35',0,100,'Sojitz Kelanitissa Power Station',0,2,NULL,NULL,NULL,99,0,1,'he Sojitz Kelanitissa Power Station (also known as Sojitz Power Station, and AES Kelanitissa Power Station), is privately-owned 172 MW diesel-fired combined cycle power station located in Kelanitissa, in the city of Colombo, Sri Lanka. It is owned by Sojitz Kelanitissa Private Limited, a subsidiary of Sojitz Corporation.[1][2] The power station is located adjacent to the Kelanitissa Power Station, which is a separate government-owned power station.',1,'2021-01-10 17:39:24.000000',0),('-','2021-01-09 14:24:55','-','2021-01-09 14:24:55',0,101,'Ceylon Petroleum Corporation',0,1,NULL,NULL,NULL,74,0,1,'Description of Ceylon Petroleum Corporation',1,NULL,0),('-','2021-01-09 14:27:59','-','2021-01-09 14:27:59',0,102,'Ceylon Petroleum Storage Terminal Ltd.',0,1,NULL,NULL,NULL,74,0,1,'Description of Ceylon Petroleum Storage Terminal Ltd.',1,NULL,0),('-','2021-01-09 15:59:45','-','2021-01-09 15:59:45',0,103,'State Ministry of Vehicle Regulation, Bus Transport Services and Train Compartments and Motor Car Industry',0,3,NULL,NULL,NULL,76,0,1,'Assisting in the formulation of policies in relation to the subject of Vehicle Regulation, bus Transport Services and Train Compartments and Motor Car Industry for \"development of transport network for effi cient and environmental friendly public transport\" under the direction and guidance of the Minister of transport in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-09 16:01:14','-','2021-01-09 16:01:14',0,104,'Department of Motor Traffic ',0,3,NULL,NULL,NULL,103,0,1,'The DMT is established to execute the rules and regulations entrusted by the Motor Traffic Act and others in an efficient manner for highest public appreciation',1,NULL,0),('-','2021-01-09 16:03:37','-','2021-01-09 16:03:37',0,106,'Sri Lanka Transport Board',0,3,NULL,NULL,NULL,103,0,1,'The Sri Lanka Transport Board is a bus service provider in Sri Lanka. Between 1958 and 1978, the Ceylon Transport Board was the nationalised enterprise which handled all public bus transport in Sri Lanka. At its peak, it was the largest omnibus company in the world — with about 7,000 buses and over 50,000 employees',1,NULL,0),('-','2021-01-09 16:04:48','-','2021-01-09 16:04:48',0,107,'National Transport Commission',0,3,NULL,NULL,NULL,76,0,1,'The NTC is established to ensure a qualitative, cost effective and safe integrated transport system and services that will provide for the socio-economic development across the country and the different mobility requirements of every individual and corporate citizen of Sri Lanka.',1,NULL,0),('-','2021-01-09 16:05:54','-','2021-01-09 16:05:54',0,108,'Sri Lanka Railway',0,3,NULL,NULL,NULL,76,0,1,'The Sri Lanka Railway Department is Sri Lanka\'s railway owner and primary operator. As part of the Sri Lankan government, it is overseen by the Ministry of Transport.',1,NULL,0),('-','2021-01-09 16:07:16','-','2021-01-09 16:07:16',0,109,'State Minister of Aviation and Export Zones Development',0,3,NULL,NULL,NULL,77,0,1,'Assisting in the formulation of policies in relation to the subject of Aviation and Export Zones Development for an \"environmental and local culture friendly, high foreign exchange earning tourism industry” under the\ndirection and guidance of the Minister of Tourism in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-09 16:08:35','-','2021-01-09 16:08:35',0,110,'Civil Aviation Authority',0,3,NULL,NULL,NULL,77,0,1,'The Civil Aviation Authority of Sri Lanka oversees the government approval and regulation of civil aviation matters for the nation of Sri Lanka. Its head office is in Katunayake as of 1 February 2018. ',1,NULL,0),('-','2021-01-09 16:10:06','-','2021-01-09 16:10:06',0,111,'State Ministry of Provincial Councils and LocalGovernment',0,3,NULL,NULL,NULL,78,0,1,'Assisting in the formulation of policies in relation to the subject of Provincial Councils and Local Government for the creation of “Work Culture for the Country” under the direction and guidance of the Minister of Public Services, Provincial Councils and Local Government in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-09 16:14:59','-','2021-01-09 16:14:59',0,112,'National Solid Waste Management Support Centre',0,3,NULL,NULL,NULL,111,0,1,'National Solid Waste Management Support Center of Sri Lanka and Waste Management Authority of Western province working with JICA to formulate a master plan on Waste management in western province for next 20 years (till 2040). Under this project, JICA took action to provide PPE\'s to be distributed among Local authorities in western province.',1,NULL,0),('-','2021-01-09 16:24:33','-','2021-01-09 16:24:33',0,113,'Sri Lanka Institute of Local Governance',0,3,NULL,NULL,NULL,111,0,1,'The Sri Lanka Institute of Local Governance (SLILG) was established under Parliamentary Act No. 31 of 1999 with the objective to enhance the institutional and management capabilities of Provincial Councils and Local Government agencies for the efficient and effective provisions of services to the people. It is mandated to conduct capacity building and supports the aims of the devolution process with promoting Good Governance through research, training, consultancies, dissemination of information leading to innovative and effective local governance.',1,NULL,0),('-','2021-01-09 16:26:05','-','2021-01-09 16:26:05',0,114,'Waste Management Authority of the Western Province',0,3,9,NULL,NULL,123,0,1,'Their Website seems to have been compromised',2,NULL,0),('-','2021-01-09 16:27:17','-','2021-01-09 16:27:17',0,115,'Eastern Provincial Council',0,3,2,NULL,NULL,59,0,1,'Description of Eastern Provincial Council',2,NULL,0),('-','2021-01-09 16:28:21','-','2021-01-09 16:28:21',0,116,'Northern Provincial Council',0,3,4,NULL,NULL,59,0,1,'Description of Northern Provincial Council',2,NULL,0),('-','2021-01-09 16:29:26','-','2021-01-09 16:29:26',0,117,'North Central Provincial Council',0,3,3,NULL,NULL,59,0,1,'Description of North Central Provincial Counci',2,NULL,0),('-','2021-01-09 16:30:29','-','2021-01-09 16:30:29',0,118,'North Western Provincial Council',0,3,5,NULL,NULL,59,0,1,'Description of North Western Provincial Council',2,NULL,0),('-','2021-01-09 16:31:31','-','2021-01-09 16:31:31',0,119,'Central Provincial Council',0,3,1,NULL,NULL,59,0,1,'Description of Central Provincial Council',2,NULL,0),('-','2021-01-09 16:32:25','-','2021-01-09 16:32:25',0,120,'Uva Provincial Council',0,3,8,NULL,NULL,59,0,1,'Description of V',2,NULL,0),('-','2021-01-09 16:33:19','-','2021-01-09 16:33:19',0,121,'Sabaragamuwa Provincial Council',0,3,6,NULL,NULL,59,0,1,'Description of Sabaragamuwa Provincial Council',2,NULL,0),('-','2021-01-09 16:35:45','-','2021-01-09 16:35:45',0,122,'Southern Provincial Council',0,3,7,NULL,NULL,59,0,1,'Description of Southern Provincial Council',2,NULL,0),('-','2021-01-09 16:36:41','-','2021-01-09 16:36:41',0,123,'Western Provincial Council',0,3,9,NULL,NULL,59,0,1,'Description of Western Provincial Council',2,NULL,0),('-','2021-01-09 16:49:49','-','2021-01-09 16:49:49',0,124,'National Water Supply and Drainage Board',0,1,NULL,NULL,NULL,79,0,1,'The National Water Supply and Drainage Board is the National Organization responsible for the provision of safe drinking water and facilitating the provision of sanitation to the people in Sri Lanka. The organization had its beginning as a sub department under the Public Works Department for water supply and drainage.',1,NULL,0),('-','2021-01-09 16:53:10','-','2021-01-09 16:53:10',0,125,'Department of Animal Production and  Health',0,3,NULL,NULL,NULL,126,0,1,'The Department of Animal Production and Health (DAPH) is the state organization which is responsible for providing technical leadership to the livestock Industry and its stakeholders in Sri Lanka. The DAPH, which  is located in Peradeniya, in the Hill Capital of Kandy, Sri Lanka is being functioned under the Ministry of  Agriculture, with the direct responsibility of State Ministry of Livestock Farm Promotion and Dairy & Egg Related Industries',1,NULL,0),('-','2021-01-09 17:01:49','-','2021-01-09 17:01:49',0,126,'State Ministry of Livestock, Farm Promotion and Dairy and Egg Related Industries',0,3,NULL,NULL,NULL,72,0,1,'Description of State Ministry of Livestock, Farm Promotion and Dairy and Egg Related Industries',1,NULL,0),('-','2021-01-09 17:03:06','-','2021-01-09 17:03:06',0,127,'State Ministry of Production and Supply of Fertilizer and Regulation of Chemical Fertilizers and Insecticide Use',0,3,NULL,NULL,NULL,72,0,1,'Description of State Ministry of Production and Supply of Fertilizer and Regulation of Chemical Fertilizers and Insecticide Use',1,NULL,0),('-','2021-01-10 09:06:54','-','2021-01-10 09:06:54',0,128,'National Fertilizer Secretariat',0,3,NULL,NULL,NULL,133,0,1,'Description of National Fertilizer Secretariat',1,NULL,0),('-','2021-01-10 09:12:55','-','2021-01-10 09:12:55',0,129,'State Ministry of Batik, Handloom and Local Apparel Products',0,3,NULL,NULL,NULL,75,0,1,'Assisting in the formulation of policies in relation to the subject of Batik, Handloom and Local Apparel Products for \"conducive business environment to promote domestic industries” under the direction and guidance of the Minister of Trade in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations',1,NULL,0),('-','2021-01-10 09:17:13','-','2021-01-10 09:17:13',0,130,'State Ministry of Gem and Jewellery related Industries',0,3,NULL,NULL,NULL,75,0,1,'Assisting in the formulation of policies in relation to the subject of Gem and Jewellry related Industries for \"conducive business environment to promote domestic industries” under the direction and guidance of the Minister of Industries in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 09:20:36','-','2021-01-10 09:20:36',0,131,'Industrial Development Board',0,3,NULL,NULL,NULL,75,0,1,'The Industrial Development Board (IDB) is a statutory body under the Ministry of Industries. It is empowered by Industrial Development Act No.36 of 1969.\n\nIn terms of this Act the IDB is the premier state organization entrusted with the responsibility of development of the Industrial Sector in Sri Lanka.',1,NULL,0),('-','2021-01-10 09:23:22','-','2021-01-10 09:23:22',0,132,'State Ministry of Rattan, Brass, Pottery, Furniture and Rural Industrial Promotion',0,3,NULL,NULL,NULL,75,0,1,'Assisting in the formulation of policies in relation to the subject of Rattan, Brass, Pottery, Furniture and Rural Industrial Promotion for \"conducive business environment to promote domestic industries” under the direction and guidance of the Minister of Industries in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 09:47:43','-','2021-01-10 09:47:43',0,133,'State Minister of Production and Supply of Fertilizer and Regulation of Chemical Fertilizer and Insecticide Use',0,3,NULL,NULL,NULL,72,0,1,'Assisting in the formulation of policies in relation to the subject of Production and Supply of Fertilizer and Regulation of Chemical Fertilizer and Insecticide use to “encourage use of quality fertilizer” under the direction and guidance of the Minister of Agriculture in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 09:59:49','-','2021-01-10 09:59:49',0,134,'State Ministry of Development of Minor Crops Plantation including Sugarcane, Maize, Cashew, Pepper, Cinnamon, Cloves, Betel Related Industries and Export Promotion',0,3,NULL,NULL,NULL,80,0,1,'Assisting in the formulation of policies in relation to the subject of Minor Crops Plantation including Sugarcane, Maize, Cashew, Pepper, Cinnamon, Cloves, Betel Related Industries and Export Promotion for the creation of an “export focused plantation industry infused with new technology “under the direction and guidance of the Minister of Plantation in conformity with the prescribed Laws',1,NULL,0),('-','2021-01-10 10:04:34','-','2021-01-10 10:04:34',0,135,'Sugarcane Research Institute',0,3,NULL,NULL,NULL,80,0,1,'The Sugarcane Research Institute (SRI) is a statutory body established by the Act of Parliament no. 75 of 1981 (ratified on 29 December 1981), for conducting research on cultivation and processing of sugarcane to cater to technical and technological needs for the development of the sugar industry of Sri Lanka, which, until 1981 was undertaken by the Research and Development Division of the Sri Lanka Sugar Corporation (SLSC).',1,NULL,0),('-','2021-01-10 10:09:29','-','2021-01-10 10:09:29',0,136,'State Ministry of Coconut, Kithul, Palmyrah and Rubber Cultivation Promotion and Related Industrial Product Manufacturing and Export Diversification',0,3,NULL,NULL,NULL,80,0,1,'Assisting in the formulation of policies in relation to the subject of Coconut, Kithul, Palmyrah and Rubber Cultivation Promotion and Related Industrial Product Manufacturing and Export Diversification for the creation of an “export focused plantation industry infused with new technology” under the direction and guidance of the Minister of Plantation in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations',1,NULL,0),('-','2021-01-10 10:21:59','-','2021-01-10 10:21:59',0,137,'Coconut Research Institute',0,3,NULL,NULL,NULL,136,0,1,'The Coconut Research Institute was founded in 1929 as the Coconut Research Scheme. under the Coconut Research Ordinance No. 24 of 1928. The scheme established its headquarters at Bandirippuwa Estate, Lunuwila with three Technical Divisions namely Genetics, Chemistry, and Soil Chemistry.',1,NULL,0),('-','2021-01-10 10:23:56','-','2021-01-10 10:23:56',0,138,'Rubber Research Institute',0,3,NULL,NULL,NULL,136,0,1,'Rubber Research Institute of Sri Lanka is the oldest research institute on rubber in the world and is the nodal agency in Sri Lanka with the statutory responsibility for research and development on all aspects of rubber cultivation and processing for the benefit of the rubber industry.',1,NULL,0),('-','2021-01-10 10:29:25','-','2021-01-10 10:29:25',0,139,'Department of Rubber Development',0,3,NULL,NULL,NULL,136,0,1,'In terms of a Cabinet Decision, the Rubber Control Department which was established under the Ordinance No.06 of 1934 was converted into Rubber Development Department (RDD) since year 1994. The RDD plays a significant role for the enhancement of the Plantation Sector implementing the regulations made by the Hon. Minister of Plantation Industries under the powers vested by the Ordinances and Acts of rubber plantation',1,NULL,0),('-','2021-01-10 10:37:22','-','2021-01-10 10:37:22',0,140,'State Ministry of Samurdhi, Household Economy, MicroFinance, Self Employment, Business Development and Underutilized State Resources Development',0,3,NULL,NULL,NULL,67,0,1,'Assisting in the formulation of policies in relation to the subject of Samurdhi, Household Economy, Micro Finance, Self Employment, Business Development and Underutilized State Resources Development for the creation of “People Centric Economy” under the direction and guidance of the Minister of Finance in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below mentioned Departments, State Corporations and Statutory Organizations',1,NULL,0),('-','2021-01-10 10:42:30','-','2021-01-10 10:42:30',0,141,'Department of Excise',0,3,NULL,NULL,NULL,67,0,1,'The Department of Excise has been broadly identified as the \"efficient and effective administration of the Liquor and the Tobacco industry in Sri Lanka through the collection of revenue and prevention of illicit manufacture and sale of such products, for development and welfare of the society, and the enforcement of the Poisons, Opium  and Dangerous Drugs Ordinance for the social protection of Sri Lanka.\"',1,NULL,0),('-','2021-01-10 10:47:54','-','2021-01-10 10:47:54',0,142,'National Enterprise Development Authority',0,3,NULL,NULL,NULL,140,0,1,'Creating a dynamic and sustainable competitive Enterprise Sector, this will contribute to the economic, political and social aspirations of the nation',1,NULL,0),('-','2021-01-10 10:55:56','-','2021-01-10 10:55:56',0,143,'Department of Export Agriculture',0,3,NULL,NULL,NULL,72,0,1,'The public interest to promote perennial spices and beverages has no more than 40 years history though the country had world wide fame for growing and trading of those commodities for centuries. Among Export Agriculture Crops, the first national effort was taken to develop coffee in 1959 through the first National Development Plan prepared by the Ministry of National Planning. The development of uneconomic tea lands was a hot issue by that time and the agriculture plan prepared by the Ministry of Agriculture proposed a subsidy scheme for planting coffee in the uneconomic tea small holdings. The effort was considered as successful and by 1963 Department of National Planning took up the issue of development of perennial spices and cocoa which they referred as the Minor Export Crops. However development of these crops in terms of perennial action were brought in to the mainstream of National Agricultural Planning only in 1971.',1,NULL,0),('-','2021-01-10 11:01:12','-','2021-01-10 11:01:12',0,144,'State Ministry of Ornamental Fish, Inland Fish and Prawn Farming, Fishery Harbour Development, Multi day Fishing Activities and Fish Exports',0,3,NULL,NULL,NULL,59,0,1,'Assisting in the formulation of policies in relation to the subject of Ornamental Fish, Inland Fish and Prawn Farming, Fishery Harbour Development, Multiday Fishing activities and Fish Exports for the creation of a “self-sufficient fisheries economy” under the direction and guidance of the Minister of Fisheries in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 11:06:32','-','2021-01-10 11:06:32',0,145,'State Ministry of Production, Supply and Regulation of Pharmaceuticals',0,3,NULL,NULL,NULL,59,0,1,'Assisting in the formulation of policies in relation to the subject of Production, Supply and Regulation of Pharmaceuticals for the creation of “Healthy Community” under the direction and guidance of the Minister of Health in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 11:31:06','-','2021-01-10 11:31:06',0,146,'State Ministry of Paddy and Grains, Organic Food, Vegetables, Fruits, Chillies, Onion and Potato Cultivation Promotion, Seed Production and Advanced Technology Agriculture',0,3,NULL,NULL,NULL,72,0,1,'Assisting in the formulation of policies in relation to the subject of Paddy and Grains, Organic Food, Vegetables, Fruits, Chilies, Onion and Potato Cultivation Promotion, Seed Production and Advanced Technology Agriculture for “Modern Technological Agriculture” under the direction and guidance of the Minister of Agriculture in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 11:39:59','-','2021-01-10 11:39:59',0,147,'Department of Agriculture',0,3,NULL,NULL,NULL,72,0,1,'The Department of Agriculture (DOA) functions under the Ministry of Agriculture and the DOA is one of the largest government departments with a high profile community of agricultural scientists and a network of institutions covering different agro ecological regions island wide',1,NULL,0),('-','2021-01-10 11:41:13','-','2021-01-10 11:41:13',0,148,'Department of Agrarian Development',0,3,NULL,NULL,NULL,146,0,1,'The Department of Agrarian Development was established on 01st October 1957 with the objective of providing necessary facilities to Sri Lankan farmer community abolishing the hitherto existed Food Department. This department empowered by the Paddy Lands Act No. 46 of 1958 is currently functions as the Department of Agrarian Development as per the Agrarian Development Act No. 46 of 2000 and its subsequent amendments.',1,NULL,0),('-','2021-01-10 11:42:28','-','2021-01-10 11:42:28',0,149,'Hector Kobbekaduwa Agrarian Research and Training Institute',0,3,NULL,NULL,NULL,146,0,1,'The HARTI was established in order to generate a range of policy analysis that would cover those key determinants of human and resource development in the agrarian sector. The institute was established in 1972 as a statutory board in collaboration with the UNDP/FAO, which functions under the Ministry of Agriculture.',1,NULL,0),('-','2021-01-10 11:44:14','-','2021-01-10 11:44:14',0,150,'Sri Lanka Council for Agricultural Research Policy',0,3,NULL,NULL,NULL,146,0,1,'SLCARP serves as an organization in an advisory capacity for co-coordinating and consolidating efforts within Sri Lanka NARS, funding research projects/programmes and promoting scientific research linkages in prioritized areas both nationally and internationally. CARP has been instrumental in promoting and facilitating research, by improving and enhancing agricultural research through documentation and communicating latest advances in research to the NARS scientists. ',1,NULL,0),('-','2021-01-10 11:45:50','-','2021-01-10 11:45:50',0,151,'Rice Research & Development Institute',0,3,NULL,NULL,NULL,147,0,1,'The Rice Research and Development Institute (RRDI) strive to bring about self-reliance in rice despite changes in trade policies that adversely affected the rice grower. It pursues this goal by consistently developing technology for obtaining high yield with excellent quality. When we look back at the DOA’s achievements in this field over the last 50 years, we see a ten-fold increase in rice production and a five and-a- half-fold increase in average yields. The increase in yield per unit area can be attributed to large-scale adoption of improved production technologies.',1,NULL,0),('-','2021-01-10 11:46:44','-','2021-01-10 11:46:44',0,152,'Colombo Commercial Fertilizer Ltd',0,1,NULL,NULL,NULL,72,0,1,'The premier fertilizer distributer and manufacturer in the country and taking pride in participating in the execution of the GOSL vision on the agricultural sector, exploring avenues for self-sustainability through product diversification, focusing on delivering quality products, and being receptive to needs of all stake holders of the organization.',1,NULL,0),('-','2021-01-10 11:47:33','-','2021-01-10 11:47:33',0,153,'Field Crop Research & Development Institute',0,3,NULL,NULL,NULL,147,0,1,'To achieve economic revitalization of the farmers in the field crops sector and to assure national food security through generation and facilitating the dissemination of technology necessary for priority field crops to cater for sustainable field crops production in Sri Lanka.',1,NULL,0),('-','2021-01-10 11:48:37','-','2021-01-10 11:48:37',0,154,'The Natural Resources Management Centre',0,3,NULL,NULL,NULL,147,0,1,'The Natural Resources Management Centre (NRMC) is mandated to optimize the use of land and water resources on scientific basis to improve national agricultural productivity in a sustainable manner. Changes in land use pattern with increasing population pressure, diminish both the quality and quantity of land and water resources while climate change and its extreme situations are exerting additional pressure on them. These issues are leading to accelerated soil erosion, declining soil fertility, salinization and retardation of water availability for agriculture and deterioration of soil and water. Therefore, development of technologies targeting judicial utilization while conserving natural resources, particularly land and water resources are a vital task. ',1,NULL,0),('-','2021-01-10 11:52:18','-','2021-01-10 11:52:18',0,155,'Tea Research Institute',0,3,NULL,NULL,NULL,80,0,1,'The Tea Research Institute (TRI), since its inception in 1925, has been the only national body in Sri Lanka for generating and disseminating new technologies related to tea cultivation and processing. The TRI has always been the driving force behind the numerous successes achieved towards development of the Sri Lankan tea industry over the years. ',1,NULL,0),('-','2021-01-10 11:56:16','-','2021-01-10 11:56:16',0,156,'National Livestock Development Board',0,3,NULL,NULL,NULL,126,0,1,'The National Livestock Development Board was established in 1973 under the State agricultural Corporation Act No. 11 of 1972. It’s field operations commenced in 1974. The redefined functions of the Board in 1977 were aimed at arresting the diminishing trend in the national herd and to concentrate on an intensive upgrading program of cattle both for the milk & draught, and to salvage as many breedable female cattle as possible. The broader objective of the Board is to uplift the socio-economic standards of the rural farmers. The many activities constitute the supply of breeding stock, to maintain and develop the Board’s Coconut Plantations, production of value added milk products and the education and training of farmers in the systems of integrated crop and livestock management. To meet these commitments the farms of the board were geared to serve the farmers in varying agro-climatic regions while livestock breeding programs were also tailored to suit those climatic variations in different zones.',1,NULL,0),('-','2021-01-10 11:58:59','-','2021-01-10 11:58:59',0,157,'Department of Animal Production and Health',0,3,NULL,NULL,NULL,147,0,1,'The Department of Animal Production and Health (DAPH) is the state organization which is responsible for providing technical leadership to the livestock Industry and its stakeholders in Sri Lanka. The DAPH, which  is located in Peradeniya, in the Hill Capital of Kandy, Sri Lanka is being functioned under the Ministry of  Agriculture, with the direct responsibility of State Ministry of Livestock Farm Promotion and Dairy & Egg Related Industries.',1,'2021-01-11 04:13:07.000000',0),('-','2021-01-10 11:59:58','-','2021-01-10 11:59:58',0,158,'Veterinary Research Institute',0,3,NULL,NULL,NULL,126,0,1,'The Veterinary Research Institute, located at Peradeniya in the central hills in Sri Lanka is the only national level organization of its kind, which is administrated by the department of Animal Production and Health under the purview of the Ministry of Livestock and Rural Community Development. The institute started as a diagnostic laboratory in Colombo in 1911 and was institutionalized in 1967.',1,NULL,0),('-','2021-01-10 12:00:02','-','2021-01-10 12:00:02',0,159,'Land Reform Commission',0,3,NULL,NULL,NULL,82,0,1,'Ensuring active contribution for the national development by way of implementing land reform process, improving productivity of lands in excess of ceiling, managing the ownership of physical resources ensuring their protection, giving effect to the maximum limit of ceiling on timely requirement, paying compensations, investing in productive economic fields and maintaining a reserve of lands which can be utilized for the benefit',1,NULL,0),('-','2021-01-10 12:04:07','-','2021-01-10 12:04:07',0,160,'Department of Land Commissioner General',0,3,NULL,NULL,NULL,82,0,1,'Maintaining a formal management that ensures the sustainability of development in a well-coordinated manner within a national policy, guides the optimal use of state lands and ensures the ownership of clear land.',1,NULL,0),('-','2021-01-10 12:05:10','-','2021-01-10 12:05:10',0,161,'The Hotels Association of Sri Lanka',0,2,NULL,NULL,NULL,77,0,1,'The THASL is the apex body of the entire hotel industry in the country. It\'s membership presently stands at 200 hotels and resorts located in different parts of the country, comprising reputed International hotel brands, leading local hotel chains, proprietorships and stand-alone properties ranging from Colombo 5* city hotels to all other star categories including top end boutique properties.',1,NULL,0),('-','2021-01-10 12:06:47','-','2021-01-10 12:06:47',0,162,'Sri Lanka Institute of Tourism and Hotel Management',0,3,NULL,NULL,NULL,77,0,1,'The Sri Lanka Institute of Tourism & Hotel Management (SLITHM) is the only Government approved premier Institute in Sri Lanka, which was established by the Government in 1964 to train young men and women in the complex eld of Hospitality and Travel Industry. SLITHM is managed by the Ministry of Tourism Development and Christian Religious Affairs. Further, in order to facilitate students island-wide, provincial schools have been set up in Anuradhapura, Bandarawela, Pallekelle, Koggala, Ratnapura, Kurunegala and Pasikudah.',1,NULL,0),('-','2021-01-10 12:07:25','-','2021-01-10 12:07:25',0,163,'Department of Surveyor General of Sri Lanka',0,3,NULL,NULL,NULL,82,0,1,'The Sri Lanka Survey Department (SLSD) under the Ministry of Land and Land Development acts as the National Surveying and Mapping agency of the government and is responsible for the standardization and production of all Surveying and Mapping activities in Sri Lanka. It is also responsible for the establishment of the national Cadaster under the Land Titling Program.',1,NULL,0),('-','2021-01-10 12:07:31','-','2021-01-10 12:07:31',0,164,'Sri Lanka Tourism Promotion Bureau',0,3,NULL,NULL,NULL,77,0,1,'The Sri Lanka Tourism Promotion Bureau (SLTPB) is the statutory body responsible for the promotion and marketing of Sri Lanka Tourism in the global context. The institution was established in 2008 after enactment of the Tourism act no. 38 of 2005 under the portfolio of the Ministry responsible for Tourism. SLTPB carries out marketing campaigns targeting both trade and consumer segments to support reaching the government’s tourism arrival and revenue targets.',1,NULL,0),('-','2021-01-10 12:10:07','-','2021-01-10 12:10:07',0,165,'State Ministry of Land Management, State Enterprises Land and Property Development',0,3,NULL,NULL,NULL,82,0,1,'Assisting in the formulation of policies in relation to the subject of Land Management, State Enterprises Land and Property Development for “optimal land management” under the direction and guidance of the Ministerof Lands in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 12:10:08','-','2021-01-10 12:10:08',0,166,'Ceylon Tourist Board',0,3,NULL,NULL,NULL,77,0,1,'In 1966, the Government decided to develop tourism in a planned and a systematic manner, after identifying the need to set up an institutional framework. The Ceylon Tourist Board (created by the Ceylon Tourist Board Act No. 10 of 1966) and the Ceylon Hotels Corporation (created by Ceylon Hotels Corporation Act of 1966) were set up duly. Created to promote rapid economic development, through the development of foreign tourism, the Ceylon Tourist Board (CTB) was a statutory body that allowed greater freedom in decision making and flexibility in financial management. The legislation also covered the establishment of a national holiday resort company, which planned various types of accommodation and resort areas. Moreover it included the setting up of an authority under the Tourist Board to manage and administer each resort.',1,NULL,0),('-','2021-01-10 12:12:40','-','2021-01-10 12:12:40',0,167,'Department of Land Settlement',0,3,NULL,NULL,NULL,165,0,1,'Creation of an advanced land management system in Sri Lanka by confirming title to every block of land on deciding the ownership of state land and private land through the procedure of registration of land settlement and title to such land.',1,NULL,0),('-','2021-01-10 12:14:21','-','2021-01-10 12:14:21',0,168,'Department of Land Use Policy Planning',0,3,NULL,NULL,NULL,165,0,1,'The Land Use Policy Planning Department was initially established as the Land Use Policy Planning Division, under the Ministry of Land Development and Mahaweli Development in 1983, with the objective of advising the Inter Ministerial Co-coordinating committee for Land Use and Development, to assist with the formulation and implementation of Land Use Policies and to develop a Land Information System. With the recruitment of District Land Use Planning Officers in 1988 land use planning activities of the division were extended to the district level, and with the appointment of Land Use Planning Assistants in 2005 the activities were further extended to the Divisional Secretary level. In the year 2010, The Division was upgraded to the status of a Department and given more responsibilities. At present the Department operates under the Ministry of Lands and Land Development.',1,NULL,0),('-','2021-01-10 12:17:00','-','2021-01-10 12:17:00',0,169,'Coconut Development Authority',0,3,NULL,NULL,NULL,136,0,1,'The Coconut Development Authority (CDA) of Sri Lanka is the statutory apex organization established under the provisions of the Coconut Development Act No. 46 of 1971. It is responsible to work for the development of the coconut industry in Sri Lanka and functions under the Ministry of Plantation Industries.',1,NULL,0),('-','2021-01-10 12:17:07','-','2021-01-10 12:17:07',0,170,'State Ministry of Urban Development, Coast Conservation, Waste Disposal and Community Cleanliness',0,3,NULL,NULL,NULL,68,0,1,'\"Assisting in the formulation of policies in relation to the subject of Urban Development, Coast Conservation, Waste\nDisposal and Community Cleanliness for the creation of “Modern Cities and Clean Country” under the direction\nand guidance of the Minister of Urban Development and Housing in conformity with the prescribed Laws, Acts and\nOrdinances and implementing, projects under the National Budget, State Investment and National Development\nProgramme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned\nDepartments, State Corporations and Statutory Organizations.\"',1,NULL,0),('-','2021-01-10 12:18:28','-','2021-01-10 12:18:28',0,171,'Department of Fisheries and Aquatic Resources',0,3,NULL,NULL,NULL,86,0,1,'Department of fisheries is mainly focusing on promoting the environmental fishing methods. Accordingly it is expected to provide technical support for the fishermen to upgrade their boats and gears enabling them to transfer to more sustainable methods of harvesting. On the other hand it is expected to uplift the socio economic aspects of the fisher folk though community development programmes.',1,NULL,0),('-','2021-01-10 12:19:05','-','2021-01-10 12:19:05',0,172,'Sri Lanka Tea Board',0,1,NULL,NULL,NULL,80,0,1,'The Tea Board is the apex regulatory and administrative body of the Sri Lankan tea industry. First set up in 1976, it comprises representatives from both private and government bodies involved in the industry',1,NULL,0),('-','2021-01-10 12:19:32','-','2021-01-10 12:19:32',0,173,'National Aquaculture Development Authority',0,3,NULL,NULL,NULL,144,0,1,'The National Aquaculture Development Authority (NAQDA) coming under the purview of the Ministry of Fisheries and Aquatic Resources was established in 1999 by the Parliamentary Act (No. 53 of 1998). It is the main state sponsored organization mandated the development of the aquaculture and inland fisheries sector in Sri Lanka.',1,NULL,0),('-','2021-01-10 12:21:17','-','2021-01-10 12:21:17',0,174,'Urban Development Authority',0,3,NULL,NULL,NULL,170,0,1,'UDA’s mission is to promote and to regulate the urban development process in order to facilitate the growth of the economy, protecting the natural and built heritage and improving the quality of life of all inhabitants. These are some of the key development programs that we are involved in.',1,NULL,0),('-','2021-01-10 12:22:41','-','2021-01-10 12:22:41',0,175,'Department of Coast Conservation and Coastal Resource Management',0,3,NULL,NULL,NULL,170,0,1,' The Coast Conservation Division was upgraded to Coast Conservation Department (CCD), in 1984 and the administration, control, custody and management of the coastal zone have been vested with Director, Coast Conservation. Amendment to the Act was passed in 1988 as the Coast Conservation (Amendment) Act No. 64 of 1988. The department was further upgrade in July, 2009, appointing the first Director General, Coast Conservation. The Coast Conservation Act requires having a survey of the Coastal Zone and preparation of a Coastal Zone Management Plan (CZMP). The CZMP, prepared by the CCD, was adopted by the Government and implemented as the Coastal Zone Management Plan 1990. A Resource Management strategy for Sri Lanka’s coastal region, “Coastal 2000”, which provided the direction for Coastal Resources Management of Sri Lanka, was prepared in1992.',1,NULL,0),('-','2021-01-10 12:23:54','-','2021-01-10 12:23:54',0,176,'Marine Environment Protection Authority',0,3,NULL,NULL,NULL,170,0,1,'The Marine Environment Protection Authority is the apex body established by the Government of Sri Lanka, under the Marine Pollution Prevention Act No. 35 of 2008, with the sole responsibility to prevent, control, and manages the pollution of Sri Lanka\'s Marine Environment',1,NULL,0),('-','2021-01-10 12:24:47','-','2021-01-10 12:24:47',0,177,'Sri Lanka Navy',0,3,NULL,NULL,NULL,66,0,1,'The Sri Lanka Navy is the naval arm of the Sri Lanka Armed Forces and is classed as the country\'s most vital defense force due to its island geography and is responsible for the maritime defense of the Sri Lankan nation and its interests.',1,NULL,0),('-','2021-01-10 12:26:53','-','2021-01-10 12:26:53',0,178,'State Ministry of Wildlife Protection, Adoption of safety measures including the construction of electrical fences and trenches and reforestation and forest resource development',0,3,NULL,NULL,NULL,71,0,1,'Assisting in the formulation of policies in relation to the subject of Wildlife Protection, Adoption of Safety Measures including the Construction of Electrical Fences and Trenches and Reforestation and Forest Resource\nDevelopment for “wildlife protection and forest conservation” under the direction and guidance of the Minister of Wildlife and Forest Conservation in conformity with the prescribed Laws, Acts and Ordinances an \nimplementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 12:29:10','-','2021-01-10 12:29:10',0,179,'State Ministry of Skills Development, Vocational Education, Research and Innovation',0,3,NULL,NULL,NULL,88,0,1,'\"Assisting in the formulation of policies in relation to the subject of Skills Development, Vocational Education,\nResearch and Innovation for the creation of “Skillful Society and a Smart Nation” under the direction and guidance\nof the Minister of Education in conformity with the prescribed Laws, Acts and Ordinances and implementing,\nprojects under the National Budget, State Investment and National Development Programme, and implementing,\nmonitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and\nStatutory Organizations.\"',1,NULL,0),('-','2021-01-10 12:30:54','-','2021-01-10 12:30:54',0,180,'Disaster Management Center',0,3,NULL,NULL,NULL,90,0,1,'\"Disaster Management Centre (DMC) is the leading agency for disaster management in Sri Lanka. It is mandated with the responsibility of implementing and coordinating national and sub-national level programmes for reducing the risk of disasters with the participation of all relevant stakeholders.\nDMC was established as per the provisions of the Sri Lanka Disaster Management Act No. 13 of 2005 as the executing agency of the National Council for Disaster Management (NCDM).\"',1,NULL,0),('-','2021-01-10 12:31:48','-','2021-01-10 12:31:48',0,181,'National Building Research Organization',0,3,NULL,NULL,NULL,90,0,1,'National Building Research Organisation is a leading research & development institution in the country and a reputed technical services provider in the fields of geotechnical engineering, landslide risk management, human settlements planning, environmental monitoring, building materials research, and engineering project management. NBRO functions under the purview of Ministry of Disaster Management.',1,NULL,0),('-','2021-01-10 12:32:06','-','2021-01-10 12:32:06',0,182,'State Timber Corporation',0,1,NULL,NULL,NULL,71,0,1,'To Produce timber and timber based products for our customers through the knowledge and skills gained over the time and to contribute to the national and environmental demands of Sri Lanka.',1,NULL,0),('-','2021-01-10 12:32:49','-','2021-01-10 12:32:49',0,183,'National Disaster Relief Services Centre',0,3,NULL,NULL,NULL,90,0,1,'National Disaster Relief Services Center is operating under the Ministry of Disaster Management since 2010 as the relief service arm of the government to support affected population in the country. The Initial establishment of the center called National Disaster Management Centre which was established in 1996 to support the implementation of the global Disaster Management agenda called International Decade for Natural Disaster Reduction (1990-99) and obligations to the Yokohama Strategy for Disaster Management.',1,NULL,0),('-','2021-01-10 12:34:30','-','2021-01-10 12:34:30',0,184,'Attorney General’s Department ',0,3,NULL,NULL,NULL,87,0,1,'The Attorney General is the Chief Legal Advisor to the Government. In that capacity he advises the Government, Government Departments, Statutory Boards and Public Corporations in respect of all legal matters. He conducts prosecutions in criminal cases and appears on behalf of the Government, Government Departments, Statutory Boards and Public Corporations in any Court or Tribunal',1,NULL,0),('-','2021-01-10 12:34:41','-','2021-01-10 12:34:41',0,185,'Department of Forest Conservation',0,3,NULL,NULL,NULL,178,0,1,'The Department of Forest Conservation is a non-ministerial government department responsible for forestry in Sri Lanka. Its mission is to protect and expand Sri Lanka\'s forests and woodlands. The head of the department is the Conservator General, Mr.Sathurusinghe.',1,NULL,0),('-','2021-01-10 12:35:17','-','2021-01-10 12:35:17',0,186,'Legal Drafts man’s Department',0,3,NULL,NULL,NULL,87,0,1,'The function of the Legal Draftsman is essentially the drafting of new legislation and amending legislation in all three languages, the preparation of statements of objects and reasons for such legislation, the revision of all subordinate legislation forwarded by the initiating Ministry or relevant authority, attending Parliament and meetings of the Select Committees of Parliament when Bills are being discussed.',1,NULL,0),('-','2021-01-10 12:44:09','-','2021-01-10 12:44:09',0,187,'Board of Investment',0,3,NULL,NULL,NULL,59,0,1,'Established in 1978, under the name Greater Colombo Economic Commission, the Board of Investment of Sri Lanka is one of the foremost investment promotion agencies in South Asia. As the apex agency for foreign direct investment in Sri Lanka, there are over 1700 enterprises under the purview of BOI in the span of its 40 years in operation.\nIn carrying out its primary function of investment promotion, the BOI aims at sector based investor targeting, while specializing in aftercare, navigating and regulating investor operations to reach its true and highest potential throughout the lifespan of the enterprise.\nWhile facilitating potential investors by coordinating among Government ministries and line agencies, BOI acts as a competent source of information, providing access and convenience to all its stakeholders through its highly capable and proactive management.\nTo achieve the national objective of reconstructing the country with a people centric economic development with sustainable investment, under the national policy framework ‘Vistas of Prosperity and Splendor’, the Board of Investment, Identified as a key strategic government institution, BOI is responsible for attracting and facilitating FDI while building new partnerships strengthened with excellence and resilience.',1,NULL,0),('-','2021-01-10 12:46:31','-','2021-01-10 12:46:31',0,188,'Sustainable Development Council',0,3,NULL,NULL,NULL,67,0,1,'The Sustainable Development Council of Sri Lanka (SDC) is the government agency tasked with monitoring and evaluation of government organisations that are working towards achieving the Sustainable Development Goals that have been undertaken by Sri Lanka, in accordance with the United Nations (UN).',1,NULL,0),('-','2021-01-10 12:47:23','-','2021-01-10 12:47:23',0,189,'Treasury Finance Committee',0,3,NULL,NULL,NULL,67,0,1,'Responsibilities in relation to macro-economic policies, annual budget and Appropriation Acts, public financial management, local and foreign savings and investments, public debts, banking, finance and insurance activities, international financial cooperation and directing social security and economic development activities.',1,NULL,0),('-','2021-01-10 12:48:13','-','2021-01-10 12:48:13',0,190,'Department of External Resources',0,3,NULL,NULL,NULL,67,0,1,'Facilitate mobilizing external financing at affordable cost with minimum conditionality in support of the economic and social development of Sri Lanka while supporting long term debt sustainability of the country.',1,NULL,0),('-','2021-01-10 12:49:27','-','2021-01-10 12:49:27',0,191,'Department of Public Finance',0,3,NULL,NULL,NULL,67,0,1,'Public Finance.lk is a platform for public finance related information and analysis in Sri Lanka. This blog is the first phase of the platform and provides infographics and insights that help the user better engage with public finance issues.  ',1,NULL,0),('-','2021-01-10 12:50:10','-','2021-01-10 12:50:10',0,192,'Department of Census and Statistics',0,3,NULL,NULL,NULL,67,0,1,'The Department of Census and Statistics (DCS), is the main Central Government Agency lying under the State Ministry of Economic Policies and Development. DCS is entrusted to collect, compile, and disseminate accurate, reliable and timely official statistics for planning and monitoring the progress of development programs and monitor the other socio-economic status of the country including Sustainable Development Goals (SDG). DCS achieve this task through conducting various censuses and surveys and compiling official statistics through administrative records. The Census of Population and Housing and Economic Census are the major censuses conducted decennially by the Department. According to the historical records, DCS has implemented officially in 1948.',1,NULL,0),('-','2021-01-10 12:50:51','-','2021-01-10 12:50:51',0,193,'Public Utilities Commission of Sri Lanka',0,3,NULL,NULL,NULL,67,0,1,'The Public Utilities Commission of Sri Lanka (PUCSL) is the economic,technical and safety regulator of the electricity industry in Sri Lanka and the and the designated regulator for petroleum and water services industries. PUCSL also has been assigned as the shadow regulator for the lubricant market in Sri Lanka.  PUCSL was established by The Public Utilities Commission of Sri Lanka Act No. 35 of 2002.',1,NULL,0),('-','2021-01-10 12:51:30','-','2021-01-10 12:51:30',0,194,'Cabinet Office',0,3,NULL,NULL,NULL,59,0,1,'It provides all support services efficiently to the decision making process of the Cabinet of Ministers in fulfilling duties pertaining to the direction and control of the Government of the Republic, vested with the Cabinet of Ministers in terms of Sub-Article 42(1) of the Constitution.',1,NULL,0),('-','2021-01-10 12:52:30','-','2021-01-10 12:52:30',0,195,'Sri Lanka Customs',0,3,NULL,NULL,NULL,67,0,1,'Sri Lanka Customs is one of the oldest Customs administrations in the world which celebrated its 200 years in 2009. However, there is evidence of the existence of Customs tax collection in Sri Lanka over 2000 years ago at the Godawaya Harbor in Hambanthota.',1,NULL,0),('-','2021-01-10 12:53:23','-','2021-01-10 12:53:23',0,196,'Central Bank of Sri Lanka',0,3,NULL,NULL,NULL,67,0,1,'The Central Bank of Sri Lanka (CBSL) is the apex institution in the financial sector in Sri Lanka. It was established in 1950 under the Monetary Law Act No. 58 of 1949 (MLA) as a semi-autonomous body and is governed by a five member Monetary Board.',1,NULL,0),('-','2021-01-10 12:54:09','-','2021-01-10 12:54:09',0,197,'Sri Lanka Standards Institution',0,3,NULL,NULL,NULL,67,0,1,'Sri Lanka Standards Institution (SLSI) is the National Standards Body of Sri Lanka, established under the Bureau of Ceylon Standards Act No. 38 of 1964. The Institution functioned under the name of Bureau of Ceylon Standards until the Act was repealed and replaced by the Sri Lanka Standards Institution Act No. 6 of 1984. The Institution now functions under the Ministry of Science, Technology and Research and  is governed by a Council appointed by the Minister in terms of the above Act.',1,NULL,0),('-','2021-01-10 12:54:57','-','2021-01-10 12:54:57',0,198,'Small and Medium Enterprise Authority',0,3,NULL,NULL,NULL,67,0,1,' The SMEA is a supreme body recommended by the Task Force to cut across administrative and financial barriers and deliver national strategies for SME development. As spelt out in the White Paper, the SMEA is the focal point for institutional support and mainly responsible for the implementation of short-term, medium-term and long-term strategies for SME development.',1,NULL,0),('-','2021-01-10 12:55:39','-','2021-01-10 12:55:39',0,199,'Department of National Planning',0,3,NULL,NULL,NULL,67,0,1,'The Department of National Planning as a part of the apex Ministry of National Policies and Economic Affairs committed to policy development, planning and implementation, to accelerate Sri Lanka\'s economic growth and social progress. This Department provides a national perspective to policies, programmes and projects, in contrast to the sectoral or regional perspectives of other institutions. It is located in the Ministry of Finance Secretariat, which helps maintain close interaction with the Treasury and its Departments.',1,NULL,0),('-','2021-01-10 12:56:19','-','2021-01-10 12:56:19',0,200,'Institute of Policy Studies',0,3,NULL,NULL,NULL,67,0,1,'The Institute of Policy Studies of Sri Lanka (IPS) is an autonomous economic research organization, established by an Act of Parliament. Our mission is to conduct high-quality, independent, policy-relevant research to provide robust evidence for policymaking and improve the lives of all Sri Lankans.',1,NULL,0),('-','2021-01-10 12:57:24','-','2021-01-10 12:57:24',0,201,'National Science Foundation',0,3,NULL,NULL,NULL,179,0,1,'The National Science Foundation of Sri Lanka was established in 1998 as the successor to the Natural Resources Energy & Science Authority of Sri Lanka established in 1981 and the National Science Council set up in 1968.',1,NULL,0),('-','2021-01-10 12:59:05','-','2021-01-10 12:59:05',0,202,'National Research Council',0,3,NULL,NULL,NULL,179,0,1,'The National Research Council of Sri Lanka (NRC) is a national funding agency of Sri Lanka, that provides financial assistance to the public sector scientists of the country. It has established as a statutory body by the Act of parliament in 2016 by the Parliament of the Democratic Socialist Republic of Sri Lanka, aiming to facilitate research relating to science and technology in order to build a vibrant scientific and technological community in the country, to promote and facilitate research relating to science and technology in higher educational institutions and public sector research institutes and other governmental institutes so as to develop a research base that will contribute to national needs and to solicit the co-operation of the private sector in the enhancement of research relating to science and technology.',1,NULL,0),('-','2021-01-10 13:08:45','-','2021-01-10 13:08:45',0,203,'State Ministry of Rural Roads and other Infrastructure',0,3,NULL,NULL,NULL,85,0,1,'\"Assisting in the formulation of policies in relation to the subject of Rural Roads and other Infrastructure for a\n\"\"Modernized Integrated Highways System\"\" under the direction and guidance of the Minister of Highways in\nconformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget,\nState Investment and National Development Programme, and implementing, monitoring and evaluating subjects\nand functions of the below-mentioned State Corporations and Statutory Organizations\"',1,NULL,0),('-','2021-01-10 13:09:32','-','2021-01-10 13:09:32',0,204,'Department of Health Services',0,3,NULL,NULL,NULL,69,0,1,'Strengthening preventive & curative health care services in an efficient, effective, equitable & innovative manner to uplift the health status of people',1,NULL,0),('-','2021-01-10 13:09:48','-','2021-01-10 13:09:48',0,205,'Sri Lanka Land Reclamation Development Corporation',0,3,NULL,NULL,NULL,170,0,1,'The Corporation is a member of National Construction Association of Sri Lanka (NCASL) and Green Building Council of Sri Lanka as well. The Cooperation has been also certified as a ISO 9001:2008 organization. SLLRDC is backed by a well-qualified and experienced staff consisting of Engineers in various Engineering disciplines such as Civil, Mechanical, Electrical, and Chemical Engineering, Architectures, Quantity Surveyors and allied professionals such as legal and other finance. The Corporation is in possession of all necessary equipment, machinery and related resources to the construction, Drainage & Reclamation Sector.',1,NULL,0),('-','2021-01-10 13:10:37','-','2021-01-10 13:10:37',0,206,'Family Health Bureau',0,3,NULL,NULL,NULL,69,0,1,'Family Health Bureau (FHB) is the focal point for Maternal and Child Health (MCH) in Sri Lanka. FHB was established in 1968 within the Ministry of Health to implement the MCH programme throughout the island. This was initially designated as the Maternal and Child Health Bureau and was later re-designated as the Family Health Bureau.',1,NULL,0),('-','2021-01-10 13:10:37','-','2021-01-10 13:10:37',0,207,'National Housing Development Authority',0,3,NULL,NULL,NULL,170,0,1,'The National Housing Development Authority has given special attention as its prime objective to assist the communities which face housing problem throughout the island. Our institution has implemented various housing development programmes during the last three decades. Under these programmes, NHDA was able to provide permanent houses to a large number of people sland wide. ',1,NULL,0),('-','2021-01-10 13:11:33','-','2021-01-10 13:11:33',0,208,'Medical Research Institute',0,3,NULL,NULL,NULL,69,0,1,'Medical Research Institute support research across the biomedical spectrum, from fundamental lab-based science to clinical trials in all major disease areas by providing expertise and resources. We also support to prepare professionals and experts within our capacity and scope in the field of laboratory diagnosis, patient monitoring and public health.  We work closely with the Ministry of Health, and give high priority to research that is likely to make a real difference to clinical practice and the health of the population',1,NULL,0),('-','2021-01-10 13:11:37','-','2021-01-10 13:11:37',0,209,'Road Development Authority',0,3,NULL,NULL,NULL,85,0,1,'The Road Development Authority; is the premier highway authority in Sri Lanka and is responsible for the maintenance and development of the National Highway Network, comprising the trunk and main roads',1,NULL,0),('-','2021-01-10 13:16:02','-','2021-01-10 13:16:02',0,210,'State Ministry of Rural and Divisional Drinking Water Supply Projects Development',0,3,NULL,NULL,NULL,79,0,1,'Assisting in the formulation of policies in relation to the subject of Rural and Divisional Drinking Water Supply Projects Development for “water for all” under the direction and guidance of the Minister of Water Supply in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned Departments, State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 13:16:16','-','2021-01-10 13:16:16',0,211,'Department of Wildlife Conservation',0,3,NULL,NULL,NULL,178,0,1,'The Department of Wildlife Conservation is a non-ministerial government department in Sri Lanka. It is the government department responsible for maintaining national parks, nature reserves and wildlife in wilderness areas in Sri Lanka',1,NULL,0),('-','2021-01-10 13:17:07','-','2021-01-10 13:17:07',0,212,'Department of National Botanic Gardens ',0,3,NULL,NULL,NULL,77,0,1,'\"Department of National Botanic Gardens is the pioneer institution for botanical activities in Sri\nLanka. Its contribution to ex-situ conservation of plants, education and implementation of\nresearch and technological programmes to develop floriculture in Sri Lanka are immense and\nvaried.\"',1,NULL,0),('-','2021-01-10 13:17:37','-','2021-01-10 13:17:37',0,213,'Department of National Zoological Gardens',0,3,NULL,NULL,NULL,77,0,1,'The Department of National Zoological Gardens, which started during the early years of the 20th century, is the pioneer institute that posses manage and conserve wild animals and display the animal collection to the public throughout the year in the country.',1,NULL,0),('-','2021-01-10 13:23:08','-','2021-01-10 13:23:08',0,214,'Department of Irrigation',0,3,NULL,NULL,NULL,84,0,1,'The Irrigation Department with over a century of experience as a pioneer organization responsible for most of the development works in the irrigation sector, looks optimistically towards the development envisage in the water sector at the dawn of the new millennium.',1,NULL,0),('-','2021-01-10 13:26:20','-','2021-01-10 13:26:20',0,215,'Water Resource Board',0,1,NULL,NULL,NULL,84,0,1,'The WRB was established in 1966 by the parliament Act No. 29 of 1964 and presently operating under Ministry of Irrigation, Water Resources Management and Disaster Management',1,NULL,0),('-','2021-01-10 13:29:14','-','2021-01-10 13:29:14',0,216,'State Ministry of canals and Common Infrastructure development in settlements in Mahaweli Zones',0,3,NULL,NULL,NULL,84,0,1,'Assisting in the formulation of policies in relation to the subject of Canals and Common Infrastructure Development in Settlements in Mahaweli Zones for the creation of “optimal irrigation management” under the direction and guidance of the Minister of Irrigation in conformity with the prescribed Laws, Acts and Ordinances and implementing, projects under the National Budget, State Investment and National Development Programme, and implementing, monitoring and evaluating subjects and functions of the below-mentioned State Corporations and Statutory Organizations.',1,NULL,0),('-','2021-01-10 13:33:03','-','2021-01-10 13:33:03',0,217,'Mahaweli Authority of Sri Lanka',0,3,NULL,NULL,NULL,216,0,1,'Description of Mahaweli Authority',1,NULL,0),('-','2021-01-10 19:02:20','-','2021-01-10 19:02:20',0,218,'Paddy Marketing Board',0,1,NULL,NULL,NULL,146,0,1,'Description of Paddy Marketing Board',1,NULL,0),('-','2021-01-11 02:28:46','-','2021-01-11 02:28:46',0,219,'ministryofpower',0,3,NULL,NULL,NULL,59,0,1,'asa',1,'2021-01-11 02:31:29.000000',0),('-','2021-01-11 05:59:22','-','2021-01-11 05:59:22',0,221,'Medical Statistics Unit',0,3,NULL,NULL,NULL,69,0,1,'Medical Statistics Unit',1,NULL,0),('-','2021-01-11 06:33:52','-','2021-01-11 06:33:52',0,222,'Biodiversity Secretariat',0,3,NULL,NULL,NULL,70,0,1,'Biodiversity Secretariat of Ministry of Environment',1,NULL,0),('-','2021-01-11 06:35:25','-','2021-01-11 06:35:25',0,223,'National Dengue Control Unit',0,3,NULL,NULL,NULL,69,0,1,'The National Dengue Control Unit is the focal point for the National Dengue Control Programme in the Ministry of Health, Sri Lanka. It was established in the year 2005 as a decision taken by the Ministry of Health following the major Dengue outbreak in year 2004. It is responsible for the coordination of Dengue Control or Preventive activities with different stakeholders.',1,NULL,0),('-','2021-01-11 06:47:27','-','2021-01-11 06:47:27',0,224,'National Aquatic Resource Research and Development Agency',0,3,NULL,NULL,NULL,86,0,1,'The National Aquatic Resources Research and Development Agency (NARA) is the principal National Institute charged with the responsibility of carrying out and coordinating research, development and management activities on the subject of Aquatic Resources in Sri Lanka. It is managed by a Board of Governors consisting partly of members appointed by the Hon. Minister of Fisheries and Ocean Resources and also of certain Ex-officio members.',1,NULL,0),('-','2021-01-11 07:19:47','-','2021-01-11 07:19:47',0,225,'Sri Lanka Tourism Development Authority',0,3,NULL,NULL,NULL,77,0,1,'Sri Lanka Tourism Development Authority (SLTDA) is the government authority tasked with planning, development, regulation, and policy implementation of tourism and related industries. Prior to SLTDA being established in 2007, these functions primarily resided with the organization known as Ceylon Tourist Board/Sri Lanka Tourist Board/Sri Lanka Tourism Board.',1,NULL,0),('-','2021-01-11 13:06:26','-','2021-01-11 13:06:26',0,227,'Epidemiology Unit',0,3,NULL,NULL,NULL,69,0,1,'The Epidemiology Unit was established in 1959 with assistance from the World Health Organization (WHO) to strengthen surveillance of communicable diseases. Initially, the unit functioned with a WHO consultant and a national counterpart, who, after further training in epidemiology, was appointed in 1961, as the Epidemiologist of the Department of Health Services. ',1,NULL,0),('-','2021-01-19 08:30:18','-','2021-01-19 08:30:18',0,237,'Srilanka transport - bus dispatch centre',0,3,NULL,NULL,NULL,106,0,1,'Srilanka transport - bus dispatch centre - Description',1,NULL,0),('-','2021-02-10 03:58:59','-','2021-02-10 03:58:59',0,239,'Metro trains central control board',0,3,NULL,NULL,NULL,106,0,1,'Metro trains central control board',1,NULL,0),('-','2021-02-22 15:01:50','-','2021-02-22 15:01:50',0,437,'Ministry of Economic Development',0,3,NULL,NULL,NULL,59,0,1,'Description of Ministry