INSERT INTO `policy` VALUES ('','2021-01-11 07:09:58','','2021-01-11 07:09:58',0,34,'The National Climate Change Policy of Sri Lanka','2011-12-31 18:30:00',1,'It describes its vision as a future in which climate change will not adversely impact Sri Lanka. In particular, guidelines and guidance have been established for all stakeholders to respond to the challenge raised by climate change. The strategy focuses on sustainable economic growth.',NULL,70,'Ministry of Mahaweli Development and Environment',0),('','2021-01-11 07:13:10','','2021-01-11 07:13:10',0,35,'Intended Nationally Determined Contributions','2015-12-31 18:30:00',1,'Sri Lanka is pleased to participate by planning globally accepted contributions to tackle the challenges of current and predicted climate change (INDCs). In accordance with the concept of shared but distinct obligation and capabilities, the INDC has been formulated.',NULL,70,'TBD',0),('','2021-01-11 07:15:14','','2021-01-11 07:15:14',0,36,'National Adaptation Plan for Climate Change Impacts in Sri Lanka 2016-2025','2015-12-31 18:30:00',1,'This plan was drawn up in line with the extensive set of guidelines for developing National Adaptation Plans (NAPs) laid down by the UNFCCC. The UNFCCC guidelines define the NAPs as a mechanism to create the capacities and expertise of all decision-makers at the national, subnational and supra-national levels. The UNFCCC NAP process is a widespread four-stage process that can be adapted in accordance with particular circumstances in individual countries. The four phases are: establishment of the foundations and identification of gaps; preparation of elements; implementing policies, and; reporting, monitoring and analysis. The third and fourth of these are post-planning phases.',NULL,89,NULL,0),('','2021-01-11 07:17:31','','2021-01-11 07:17:31',0,37,'National Biodiversity Strategic Action Plan 2016-2022','2015-12-31 18:30:00',1,'The National Biodiversity Strategic Action Plan acting as a holistic strategy and a detailed road map, which offers a description of our current state of natural resources and proposes that our island\'s biodiversity be incorporated into national growth, in order to achieve a difficult balance between improving and maintaining our rich natural heritage. This further helps to achieve strategic goals to manage the country’s sustainable management of biodiversity.',NULL,222,NULL,0),('','2021-01-11 07:21:33','','2021-01-11 07:21:33',0,38,'National Agriculture Research Policy and Strategy 2018 - 2027','2017-12-31 18:30:00',1,'This policy adequately cover and be flexible in meeting the challenges of the agricultural sector. The policy addresses issues such as: meeting the needs of food security People,  competitiveness sustainability of the system, globalization, and climate change; technological challenges, such as genetically modified crops adoption, the management of land toxicity and environmental degradation due to non-discriminatory use of agricultural products and erosion of soil etc.',NULL,150,NULL,0),('','2021-01-11 07:24:10','','2021-01-11 07:24:10',0,39,'National Energy Policy and Strategies of Sri Lanka','2018-12-31 18:30:00',1,'This policy aims to ensure energy security through supplies that are cleaner, secure, economical and reliable, to provide convenient, affordable energy services to support socially equitable development of Sri Lanka. This policy document has three sections: 1) The National Energy Policy, stating the ten pillars of the policy framework. 2) Implementing Strategies, describing the specific strategies to implement the policy. 3) The Results Delivery Framework, elaborating the specific actions, milestones and the institutions responsible.',NULL,73,NULL,0),('','2021-01-11 07:25:45','','2021-01-11 07:25:45',0,40,'Ceylon Electricity Board Long Term Generation Expansion Plan 2018-2037','2017-12-31 18:30:00',1,'This includes information on the current generation system, the methodology for generation planning, the provision of the system demand and expenditure and the implementation plans of planned plants, and suggests adoption of a lower cost plant sequence based on the basic case. It also briefly enagaged with climate change aspects with regards to energy sectore.','2021-01-12 03:46:14.000000',96,NULL,0),('','2021-01-11 07:41:41','','2021-01-11 07:41:41',0,41,'Western Region Megapolis Masterplan','2015-12-31 18:30:00',1,'The Western Megapolis is conceived as the prudence of the Grand Strategy to achieve two decisive, interdependent changes in the Sri Lankan March to achieve the status of \'a high-income developed country\': the spatial transformation of urban agglomerations in Sri Lanka\'s Western Region, the structural transformation of the national economy into a prudent country. Western Megapolis has 3 large national objectives: -To tackle the problems emerging from \'messy urbanization\' congestion pressures. - Build an enabling climate to drive the country into a high income developing country; - Take advantage of an international environment dominated by knowledge-based innovation characterized by such innovations as the \'new industrial revolution\' and the rise of \'smart towns\'',NULL,123,NULL,0),('','2021-01-11 07:43:28','','2021-01-11 07:43:28',0,42,'The National Policy on Health Information 2017 ','2016-12-31 18:30:00',1,'This policy creates a \'information culture,\' in which it promotes the use for decision making of accurate, high quality information. It will enhance the performance of Sri Lanka\'s health systems, improve health care quality, universal access, increase services delivery, and enhance the cost efficiency of Sri Lankan health services. I think that this compilation will assist us in achieving these objectives.',NULL,69,NULL,0),('','2021-01-11 07:45:36','','2021-01-11 07:45:36',0,43,'National Wetland Policy and Strategy','2005-12-31 18:00:00',1,'Wetlands are threatened by human activities including reclamation, waste disposal, industrial and domestic effluent discharge, harvesting of vegetation for firewood and other uses and invasive exotic species. The degradation of wetland habitats carries a high economic, social and ecological cost. This policy objected to protect and conserve wetland ecosystems, to prevent illegal utilization of wetlands, to enhance ecosystem services from wetland habitats and etc.',NULL,92,NULL,0),('','2021-01-11 07:47:06','','2021-01-11 07:47:06',0,44,'Sri Lanka National Health Policy 2016-2025','2015-12-31 18:30:00',1,'This policy framework addresses health issues and tackle with new and different strategies, Further strategies in development of health system.',NULL,69,NULL,0),('','2021-01-11 07:48:12','','2021-01-11 07:48:12',0,45,'Sri Lanka National Health Policy 2016-2025','2015-12-31 18:30:00',1,'This policy framework addresses health issues and tackle with new and different strategies, Further strategies in development of health system.','2021-01-11 08:01:21.000000',69,NULL,0),('','2021-01-11 08:02:30','','2021-01-11 08:02:30',0,46,'National Waste Management Policy','2017-12-31 18:30:00',1,'Provides coherent and detailed guidance for the waste management of solid, liquid and gaseous residues in the region, with obligation to meet acute short-term challenges in keeping with viable, medium- and long-term solutions by 2030.',NULL,70,NULL,0),('','2021-01-19 09:33:27','','2021-01-19 09:33:27',0,48,'Metro bus project - Western province - policy','2020-12-31 18:30:00',1,'Metro bus project - Western province - policy',NULL,106,'Tourism and recreation',0),('','2021-01-29 05:22:20','','2021-01-29 05:22:20',0,51,'Metro bus project - All island','2015-01-31 18:30:00',2,'Metro bus project - All island',NULL,85,'Metro bus project - All island',0),('','2021-01-31 16:44:43','','2021-01-31 16:44:43',0,53,'Metro bus project - Sri Lanka - Policy 2021','2016-01-31 18:30:00',1,'Metro bus project - Sri Lanka - Policy 2021',NULL,106,'Sri lanka transport board',0),('','2021-02-11 02:58:03','','2021-02-11 02:58:03',0,56,'Metro trains policy - provincial','2021-02-28 18:30:00',2,'Metro trains policy - provincial description verify',NULL,106,'Metro trains policy - provincial',0),('','2021-03-09 02:05:52','','2021-03-09 02:05:52',0,71,'Metro transport policy 2021','2021-02-28 18:30:00',1,'Metro transport policy 2021 - Description',NULL,106,'Sri lanka transport board - Original formulation Institution',1),('','2022-09-15 11:53:15','','2022-09-15 11:53:15',0,192,'National transport policy 2021','2022-09-15 18:30:00',1,'National transport policy',NULL,76,'Ministry of Transport',0),('','2022-09-15 11:59:20','','2022-09-15 11:59:20',0,193,'Sustainability policy 2022','2022-09-15 18:30:00',2,'Sustainability policy 2022',NULL,70,'MOE',0);
